```

i have worked around this in my own program:
```zig
pub fn ln(x: anytype) @TypeOf(x) {
    const frexp = std.math.frexp(x);
    return std.math.log1p(frexp.significand * 2 - 1) + std.math.ln2 * @as(@TypeOf(x), @floatFromInt(frexp.exponent - 1));
}

pub fn log2(x: anytype) @TypeOf(x) {
    const frexp = std.math.frexp(x);
    return @log2(frexp.significand) + @as(@TypeOf(x), @floatFromInt(frexp.exponent));
}

pub fn log(T: type, base: T, x: T) T {
    return switch (comptime how_to_logarithm) {
        .by_corrected_log2 => log2(x) / log2(base),
        .by_half_corrected_log2 => log2(x) / @log2(base),
        .by_ln_log1p => ln(x) / ln(base),
        .by_log2 => @log2(x) / @log2(base),
        .by_builtin => @log(x) / @log(base),
    };
}
```

